import React from 'react';
import './Gallary.css'; 
import image0 from '../../asserts/e1.jpeg';
import image1 from '../../asserts/e6.jpg';
import image2 from '../../asserts/e9.jpg';
import image3 from '../../asserts/e10.jpeg';
import image4 from '../../asserts/e11.jpeg';
import image5 from '../../asserts/e12.jpeg';
import image6 from '../../asserts/e7.jpeg';
import image7 from '../../asserts/e13.jpeg';

const Gallary = () => {
  return (
    <div className="gal" id="gallery">
      <h1 className="galhead"><span>Our</span> Gallery</h1>

      <div className="galcont">
        <div className="box">
          <img src={image0} alt="Event venue setup with decorations" />
        </div>

        <div className="box">
          <img src={image1} alt="Guests enjoying an event" />
        </div>

        <div className="box">
          <img src={image2} alt="Evening event with lighting" />
        </div>

        <div className="box">
          <img src={image3} alt="Event catering with food" />
        </div>

        <div className="box">
          <img src={image4} alt="Entertainment stage setup" />
        </div>

        <div className="box">
          <img src={image5} alt="Group photo from an event" />
        </div>

        <div className="box">
          <img src={image6} alt="Decorated event hall" />
        </div>

        <div className="box">
          <img src={image7} alt="Event attendees interacting" />
        </div>
      </div>
    </div>
  );
};

export default Gallary;
